`,Mt(t.p,{children:"Real-world robots localize objects from natural-language instructions while scenes around them keep changing. Yet most of the existing 3D visual grounding (3DVG) method still assumes a reconstructed and up-to-date point cloud, an assumption that forces costly re-scans and hinders deployment. We argue that 3DVG should be formulated as an active, memory-driven problem, and we introduce ChangingGrounding, the first benchmark that explicitly measures how well an agent can exploit past observations, explore only where needed, and still deliver precise 3D boxes in changing scenes. To set a strong reference point, we also propose Mem-ChangingGrounder, a zero-shot method for this task that marries cross-modal retrieval with lightweight multi-view fusion: it identifies the object type implied by the query, retrieves relevant memories to guide actions, then explores the target efficiently in the scene, falls back when previous operations are invalid, performs multi-view scanning of the target, and projects the fused evidence from multi-view scans to get accurate object bounding boxes. We evaluate different baselines on ChangingGrounding, and our Mem-ChangingGrounder achieves the highest localization accuracy while greatly reducing exploration cost. We hope this benchmark and method catalyze a shift toward practical, memory-centric 3DVG research for real-world applications."})]})}function kq(e={}){const{wrapper:t}=e.components||{};return t?Mt(t,{...e,children:Mt(Ub,{...e})}):Ub(e)}const Eq={__name:"Abstract",setup(e){return(t,n)=>{const o=ze("el-divider"),a=ze("el-col"),l=ze("el-row");return E(),D("div",null,[z(o),z(l,{justify:"center"},{default:G(()=>[z(a,{xs:24,sm:20,md:16,lg:14,xl:12},{default:G(()=>[z(i(kq))]),_:1})]),_:1})])}}};function Yb(e){const t={h1:"h1",p:"p",...e.components};return Mt(Be,{children:[Mt(t.h1,{children:"ChangingGrounding Benchmark"}),`
`,Mt("p",{align:"center",children:Mt("img",{src:"teaser-zhiwei_01.png",width:"800"})}),`
`,Mt(t.p,{children:"Traditional 3D visual grounding methods rely on complete 3D scene point clouds and assume static environments. However, these approaches face significant limitations when deployed in real-world robotic systems: real environments are dynamic. Robots must rescan the entire scene to reconstruct point clouds, which is costly; otherwise, they usually do not even know whether or where changes occurred. In contrast, humans use memories of past scenes to focus on likely areas and localize targets with only a few new observations. Inspired by this ability, we define a new task: memory-based 3D visual grounding in changing scenes, the ChangingGrounding Benchmark. The system is given past scene observations, the current scene, and a user query. Its goal is to localize the target object efficiently and accurately. Performance is measured by both the accuracy of the predicted 3D bounding box and the cost of exploration."}),`
`,Mt("p",{align:"center",children:Mt("img",{src:"datacompare.png",width:"600"})}),`
`,Mt(t.p,{children:"To support this new task, we built the ChangingGrounding dataset, derived from 3RScan. It provides (1) spatial-relation queries of target objects, (2) RGB-D images with camera poses as memory, and (3) re-rendered frames for new observations. Compared with existing benchmarks, the ChangingGrounding dataset is quite big and the only one designed for changing environments."})]})}function Tq(e={}){const{wrapper:t}=e.components||{};return t?Mt(t,{...e,children:Mt(Yb,{...e})}):Yb(e)}const $q={__name:"benchmark",setup(e){return(t,n)=>{const o=ze("el-divider"),a=ze("el-col"),l=ze("el-row");return E(),D("div",null,[z(o),z(l,{justify:"center"},{default:G(()=>[z(a,{xs:24,sm:20,md:16,lg:14,xl:12},{default:G(()=>[z(i(Tq))]),_:1})]),_:1})])}}};function Gb(e){const t={h1:"h1",p:"p",...e.components};return Mt(Be,{children:[Mt(t.h1,{children:"Mem-ChangingGrounder (MCG)"}),`
`,Mt("p",{align:"center",children:Mt("img",{src:"mainmethod_0804_01.png",width:"800"})}),`
`,Mt(t.p,{children:"To address our new task, we introduce Mem-ChangingGrounder (MCG), a zero-shot framework based on VLM-Grounder for 3D visual grounding in changing scenes. MCG takes a user query in the current scene and predicts the 3D bounding box of the target object, using the memory of the previous scene represented as RGB-D images and camera poses. As shown in the figure above, MCG has two action policies (Omnidirectional Scene Scanner (OSS) and the Spatial Relation Aware Scanner (SRAS)) within four core modules: Query Classification, Memory Retrieval and Grounding, Fallback, and Multi-view Projection. The workflow is as follows: first, the query is classified to determine the path for retrieval and grounding. MCG then explores the current scene with action policies to locate the target. If this fails, the fallback module estimates the target. Finally, multi-view information is fused for accurate grounding. More detailed explanations are provided in the full paper."})]})}function Mq(e={}){const{wrapper:t}=e.components||{};return t?Mt(t,{...e,children:Mt(Gb,{...e})}):Gb(e)}const xq={__name:"mcg",setup(e){return(t,n)=>{const o=ze("el-divider"),a=ze("el-col"),l=ze("el-row");return E(),D("div",null,[z(o),z(l,{justify:"center"},{default:G(()=>[z(a,{xs:24,sm:20,md:16,lg:14,xl:12},{default:G(()=>[z(i(Mq))]),_:1})]),_:1})])}}};function qb(e){const t={h1:"h1",p:"p",...e.components};return Mt(Be,{children:[Mt(t.h1,{children:"Experiment Results"}),`
`,Mt(t.p,{children:"We compare our Mem-ChangingGrounder (MCG) with three baselines that cover two simplified scenarios, using only exploration without memory or using only memory without exploration. The first baseline, Wandering Grounding, corresponds to the original VLM-Grounder that uses all images and poses from the current scene. The second, Central Rotation Grounding, applies the VLM-Grounder to images captured by rotating at the initial pose of the scene. The third, Memory-Only Grounding, employs the VLM-Grounder but only with images from the previous scene as memory."}),`
